import React from 'react'

function Resetpassword() {
    return (
        <div className="resetpassword">

            <form action="">
                <label htmlFor="">Enter email address</label>
                <input type="text" name="email" value="" />

                <button>SUBMIT</button>


            </form>
            
        </div>
    )
}

export default Resetpassword
